import { defineStore } from 'pinia'
import { useStorage } from '@vueuse/core'
import Cookies from 'js-cookie'

export const user = defineStore({
    id: 'UserData',
    state: () => ({
        PFP: 'data:image/jpeg;base64,',
        USER_DATA: useStorage('USER_DATA', {}),
        MODULE: useStorage('MODULE', []),
        ACCESS_LEVEL:useStorage('ACCESS_LEVEL', null),
     } as any),
    actions: {
        LOGOUT() {
            Cookies.remove('accessCode', { domain: '.nexamedia.co.id' });
            this.USER_DATA = {}
            this.MODULE = []
            this.ACCESS_LEVEL = null
        },
        SET_USER(payload: any) {
            this.USER_DATA = payload 
        },
        SET_USER_MODULE(payload:any){
            this.MODULE = payload
        },
        SET_ACCESS_LEVEL(payload:any){
            this.ACCESS_LEVEL = payload
        }
    }
    
})